function frt_addEvent(id, relationId) {
    var _obj = $('#' + id +"women");
    _obj.attr({
        'fill': frt_config[id+"women"].upColor,
        'fill-opacity': frt_config[id+"women"].upOpacity,
        'stroke': frt_config[id+"women"].outlineUpColor,
        'stroke-opacity': frt_config[id+"women"].outlineUpOpacity
    });
    _obj.attr({
        'cursor': 'default'
    });
    if (frt_config[id+"women"].enable == !0) {
        if (isTouchEnabled()) {
            _obj.on('touchstart', function(e) {
                var touch = e.originalEvent.touches[0];
                var x = touch.pageX + 10,
                    y = touch.pageY + 15;
                var tipw = $('#organs-tip').outerWidth(),
                    tiph = $('#organs-tip').outerHeight(),
                    x = (x + tipw > $(document).scrollLeft() + $(window).width()) ? x - tipw - (20 * 2) : x
                y = (y + tiph > $(document).scrollTop() + $(window).height()) ? $(document).scrollTop() + $(window).height() - tiph - 10 : y
                $('#' + id +"women").css({
                    'fill': frt_config[id+"women"].overColor,
                    'fill-opacity': frt_config[id+"women"].downOpacity,
                    'stroke': frt_config[id+"women"].outlineDownColor,
                    'stroke-opacity': frt_config[id+"women"].outlineDownOpacity
                });
                $('#organs-tip').show().html(frt_config[id+"women"].hover);
                $('#organs-tip').css({
                    left: x,
                    top: y
                })
            })
            _obj.on('touchend', function() {
                $('#' + id +"women").css({
                    'fill': frt_config[id+"women"].upColor,
                    'fill-opacity': frt_config[id+"women"].upOpacity,
                    'stroke': frt_config[id+"women"].outlineUpColor,
                    'stroke-opacity': frt_config[id+"women"].outlineUpOpacity
                });
                if (frt_config[id+"women"].target == 'new_window') {
                    window.open(frt_config[id+"women"].url)
                } else if (frt_config[id+"women"].target == 'same_window') {
                    window.parent.location.href = frt_config[id+"women"].url
                }
            })
        }
        _obj.attr({
            'cursor': 'pointer'
        });
        _obj.hover(function() {
            $('#organs-tip').show().html(frt_config[id+"women"].hover);
            _obj.css({
                'fill': frt_config[id+"women"].overColor,
                'fill-opacity': frt_config[id+"women"].overOpacity,
                'stroke': frt_config[id+"women"].outlineOverColor,
                'stroke-opacity': frt_config[id+"women"].outlineOverOpacity
            })
        }, function() {
            $('#organs-tip').hide();
            $('#' + id +"women").css({
                'fill': frt_config[id+"women"].upColor,
                'fill-opacity': frt_config[id+"women"].upOpacity,
                'stroke': frt_config[id+"women"].outlineUpColor,
                'stroke-opacity': frt_config[id+"women"].outlineUpOpacity
            })
        })
        _obj.mousedown(function() {
            $('#' + id +"women").css({
                'fill': frt_config[id+"women"].downColor,
                'fill-opacity': frt_config[id+"women"].downOpacity,
                'stroke': frt_config[id+"women"].outlineDownColor,
                'stroke-opacity': frt_config[id+"women"].outlineDownOpacity
            })
        })
        _obj.mouseup(function() {
            $('#' + id +"women").css({
                'fill': frt_config[id+"women"].overColor,
                'fill-opacity': frt_config[id+"women"].overOpacity,
                'stroke': frt_config[id+"women"].outlineOverColor,
                'stroke-opacity': frt_config[id+"women"].outlineOverOpacity
            });
            if (frt_config[id+"women"].target == 'new_window') {
                window.open(frt_config[id+"women"].url)
            } else if (frt_config[id+"women"].target == 'same_window') {
                window.parent.location.href = frt_config[id+"women"].url
            }
        })
        _obj.mousemove(function(e) {
            var x = e.pageX + 10,
                y = e.pageY + 15;
            var tipw = $('#organs-tip').outerWidth(),
                tiph = $('#organs-tip').outerHeight(),
                x = (x + tipw > $(document).scrollLeft() + $(window).width()) ? x - tipw - (20 * 2) : x
            y = (y + tiph > $(document).scrollTop() + $(window).height()) ? $(document).scrollTop() + $(window).height() - tiph - 10 : y
            $('#organs-tip').css({
                left: x,
                top: y
            })
        })
    }
}

