$(function() {
    var points_len = frt_spots.spotswomen.length;
    if (points_len > 0) {
        var xmlns = "http://www.w3.org/2000/svg";
        var tsvg_obj = document.getElementById("frt_spotswomen");
        var svg_circle;
        for (var i = 0; i < points_len; i++) {
            svg_circle = document.createElementNS(xmlns, "circle");
            svg_circle.setAttributeNS(null, "cx", frt_spots.spotswomen[i].pos_X);
            svg_circle.setAttributeNS(null, "cy", frt_spots.spotswomen[i].pos_Y);
            svg_circle.setAttributeNS(null, "r", frt_spots.spotswomen[i].diameter / 2);
            svg_circle.setAttributeNS(null, "fill", frt_spots.spotswomen[i].upColor);
            svg_circle.setAttributeNS(null, "fill-opacity", frt_spots.spotswomen[i].upOpacity);
            svg_circle.setAttributeNS(null, "stroke", frt_spots.spotswomen[i].outlineUpColor);
            svg_circle.setAttributeNS(null, "stroke-opacity", frt_spots.spotswomen[i].outlineUpOpacity);
            svg_circle.setAttributeNS(null, "id", 'frt_spots_' + i + "women");
            tsvg_obj.appendChild(svg_circle);
            dynamicfrt_addEvent(i)
        }
    }
});

